const task=[
  {
    id:1,
    text:'Doctors Appointment',
    day:'Feb 5th at 2:30 pm',
    reminder:true,
  },
  {
    id:1,
    text:'Meeting at School',
    day:'Feb 5th at 2:30 pm',
    reminder:true,
  },
  {
    id:1,
    text:'Food Shopping',
    day:'Feb 5th at 2:30 pm',
    reminder:false,
  }
]
import React from 'react'

const Task = () => {
  return (
    <>
    {
      task.map((task)=>(
        <h3> {task.text}</h3>
      ))
    }
    
    </>
  )
}

export default Task
